"""
Agent DQN pour Sailing Challenge - Soumission Codabench

Modèle converti depuis : final_model.pth
Architecture : CNN + MLP (Pure NumPy, pas de PyTorch)

Statistiques :
- Paramètres totaux : 63,129
- Physics features : 12
- Goal : (16, 31)
"""

import numpy as np
import base64
import io
import pickle
from typing import Tuple

# Import BaseAgent avec fallback

from src.agents.base_agent import BaseAgent



def compute_physics_features(obs: np.ndarray, goal: Tuple[int, int]) -> np.ndarray:
    """
    Calcule les features physiques normalisées.
    
    Args:
        obs: Observation brute [x, y, vx, vy, wx, wy, ...]
        goal: Position du goal (x, y)
    
    Returns:
        Physics features (12 features)
    """
    x, y = obs[0], obs[1]
    vx, vy = obs[2], obs[3]
    wx, wy = obs[4], obs[5]
    
    # Constantes
    MAX_DIST = 50.0
    MAX_SPEED = 7.0
    MAX_WIND = 7.0
    
    # Position relative au goal
    dx = goal[0] - x
    dy = goal[1] - y
    dist = np.sqrt(dx**2 + dy**2)
    
    if dist > 0:
        dir_goal_x = dx / dist
        dir_goal_y = dy / dist
    else:
        dir_goal_x, dir_goal_y = 0.0, 0.0
    
    feat_dist = np.clip(dist / MAX_DIST, 0, 1)
    
    # Vitesse du bateau
    speed = np.sqrt(vx**2 + vy**2)
    if speed > 0.01:
        dir_boat_x = vx / speed
        dir_boat_y = vy / speed
    else:
        dir_boat_x, dir_boat_y = 0.0, 0.0
    
    feat_speed = np.clip(speed / MAX_SPEED, 0, 1)
    
    # Vent
    wind_speed = np.sqrt(wx**2 + wy**2)
    if wind_speed > 0:
        dir_wind_x = wx / wind_speed
        dir_wind_y = wy / wind_speed
    else:
        dir_wind_x, dir_wind_y = 0.0, 0.0
    
    feat_wind_str = np.clip(wind_speed / MAX_WIND, 0, 1)
    
    # Relations (dot products)
    feat_align_goal = dir_boat_x * dir_goal_x + dir_boat_y * dir_goal_y
    feat_wind_goal = dir_wind_x * dir_goal_x + dir_wind_y * dir_goal_y
    feat_angle_wind = dir_boat_x * dir_wind_x + dir_boat_y * dir_wind_y
    
    # Cross products
    feat_cross_goal = dir_boat_x * dir_goal_y - dir_boat_y * dir_goal_x
    feat_cross_wind = dir_boat_x * dir_wind_y - dir_boat_y * dir_wind_x
    
    features = np.array([
        feat_dist,
        feat_speed,
        feat_wind_str,
        feat_align_goal,
        feat_wind_goal,
        feat_angle_wind,
        feat_cross_goal,
        feat_cross_wind,
        dir_boat_x,
        dir_boat_y,
        dir_wind_x,
        dir_wind_y
    ], dtype=np.float32)
    
    return features


class NumpyCNN:
    """CNN implémenté en NumPy pur."""
    
    def __init__(self, weights_dict):
        self.weights = weights_dict
    
    @staticmethod
    def conv2d(x, weight, bias, stride=1, padding=0):
        """Convolution 2D manuelle."""
        batch_size, in_channels, H, W = x.shape
        out_channels, _, kH, kW = weight.shape
        
        if padding > 0:
            x = np.pad(x, ((0, 0), (0, 0), (padding, padding), (padding, padding)), mode='constant')
            H, W = H + 2 * padding, W + 2 * padding
        
        H_out = (H - kH) // stride + 1
        W_out = (W - kW) // stride + 1
        
        output = np.zeros((batch_size, out_channels, H_out, W_out), dtype=np.float32)
        
        for b in range(batch_size):
            for oc in range(out_channels):
                for i in range(H_out):
                    for j in range(W_out):
                        h_start = i * stride
                        w_start = j * stride
                        receptive_field = x[b, :, h_start:h_start+kH, w_start:w_start+kW]
                        output[b, oc, i, j] = np.sum(receptive_field * weight[oc]) + bias[oc]
        
        return output
    
    @staticmethod
    def relu(x):
        return np.maximum(0, x)
    
    @staticmethod
    def adaptive_avg_pool2d(x):
        return np.mean(x, axis=(2, 3), keepdims=True)
    
    def forward(self, x):
        """Forward pass du CNN."""
        # Conv1
        x = self.conv2d(x, self.weights['wind_cnn.0.weight'],
                       self.weights['wind_cnn.0.bias'], stride=2, padding=2)
        x = self.relu(x)
        
        # Conv2
        x = self.conv2d(x, self.weights['wind_cnn.2.weight'],
                       self.weights['wind_cnn.2.bias'], stride=2, padding=1)
        x = self.relu(x)
        
        # Conv3
        x = self.conv2d(x, self.weights['wind_cnn.4.weight'],
                       self.weights['wind_cnn.4.bias'], stride=2, padding=1)
        x = self.relu(x)
        
        # Global Average Pooling
        x = self.adaptive_avg_pool2d(x)
        x = x.reshape(x.shape[0], -1)
        
        return x


class NumpyMLP:
    """MLP implémenté en NumPy pur."""
    
    def __init__(self, weights_dict):
        self.weights = weights_dict
    
    @staticmethod
    def relu(x):
        return np.maximum(0, x)
    
    def forward(self, x, prefix):
        """Forward pass du MLP."""
        layer_idx = 0
        while f'{prefix}.{layer_idx}.weight' in self.weights:
            weight = self.weights[f'{prefix}.{layer_idx}.weight']
            bias = self.weights[f'{prefix}.{layer_idx}.bias']
            
            x = np.dot(x, weight.T) + bias
            
            next_layer_exists = f'{prefix}.{layer_idx + 2}.weight' in self.weights
            
            if next_layer_exists or (prefix != 'combine'):
                x = self.relu(x)
            
            layer_idx += 2
        
        return x


class MyAgentDQN(BaseAgent):
    """
    Agent DQN pour soumission Codabench.
    Modèle converti depuis final_model.pth.
    """
    
    def __init__(self):
        super().__init__()
        
        self.goal = (16, 31)
        
        # Décoder les poids
        encoded_data = ""
        decoded_data = base64.b64decode(encoded_data)
        buffer = io.BytesIO(decoded_data)
        weights_dict = pickle.load(buffer)
        
        # Initialiser les réseaux
        self.cnn = NumpyCNN(weights_dict)
        self.mlp = NumpyMLP(weights_dict)
    
    def act(self, observation):
        """
        Sélectionne l'action avec la plus grande Q-value.
        
        Args:
            observation: Observation brute [x, y, vx, vy, wx, wy, wind_field...]
        
        Returns:
            action: Entier entre 0 et 8
        """
        # Extraction du wind field
        wind_field = observation[6:].reshape(32, 32, 2)
        
        # Features physiques
        physics = compute_physics_features(observation, self.goal)
        
        # Conversion en tenseurs NumPy
        wind_tensor = wind_field.transpose(2, 0, 1).astype(np.float32)
        wind_tensor = wind_tensor.reshape(1, 2, 32, 32)
        
        physics_tensor = physics.reshape(1, -1)
        
        # Forward pass
        wind_features = self.cnn.forward(wind_tensor)
        physics_features = self.mlp.forward(physics_tensor, 'physics_mlp')
        
        combined = np.concatenate([wind_features, physics_features], axis=1)
        q_values = self.mlp.forward(combined, 'combine')
        
        # Argmax
        action = np.argmax(q_values[0])
        
        return int(action)
    
    def reset(self):
        """Reset pour nouvel épisode."""
        pass
    
    def seed(self, seed=None):
        """Définit le seed aléatoire."""
        self.np_random = np.random.default_rng(seed)
